import React from 'react';
import { 
  Box, 
  Typography, 
  IconButton, 
  Stack, 
  Chip,
  Paper,
  Container,
  Breadcrumbs,
  Link
} from '@mui/material';
import { ArrowLeft, Shield, Package, Star, TrendingUp } from 'lucide-react';
import { motion } from 'framer-motion';

const EnhancedTierHeader = ({ bundle, subBundle, onBackClick, isDarkMode }) => {
  const headerVariants = {
    hidden: { opacity: 0, y: -50 },
    visible: {
      opacity: 1,
      y: 0,
      transition: { duration: 0.8, ease: [0.25, 0.46, 0.45, 0.94] }
    }
  };

  const decorativeVariants = {
    hidden: { scale: 0, rotate: -180 },
    visible: {
      scale: 1,
      rotate: 0,
      transition: { delay: 0.5, duration: 0.6, ease: "easeOut" }
    }
  };

  const buttonVariants = {
    hover: { 
      scale: 1.05,
      x: -5,
      transition: { duration: 0.2 }
    },
    tap: { scale: 0.95 }
  };

  return (
    <motion.div
      variants={headerVariants}
      initial="hidden"
      animate="visible"
    >
      <Box
        sx={{
          background: 'linear-gradient(135deg, #1a1a1a 0%, #2d2d2d 100%)',
          borderBottom: '1px solid rgba(255, 255, 255, 0.1)',
          position: 'relative',
          overflow: 'hidden'
        }}
      >
        {/* Decorative Background Elements */}
        <motion.div variants={decorativeVariants}>
          <Box
            sx={{
              position: 'absolute',
              top: -50,
              right: -50,
              width: 200,
              height: 200,
              borderRadius: '50%',
              background: 'radial-gradient(circle, rgba(156, 39, 176, 0.1) 0%, transparent 70%)',
            }}
          />
        </motion.div>

        <motion.div variants={decorativeVariants}>
          <Box
            sx={{
              position: 'absolute',
              bottom: -30,
              left: -30,
              width: 150,
              height: 150,
              borderRadius: '50%',
              background: 'radial-gradient(circle, rgba(33, 150, 243, 0.1) 0%, transparent 70%)',
            }}
          />
        </motion.div>

        <Container maxWidth="lg">
          <Box sx={{ py: 4 }}>
            {/* Breadcrumbs */}
            <motion.div
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: 0.3, duration: 0.5 }}
            >
              <Breadcrumbs 
                separator="›" 
                sx={{ mb: 3, '& .MuiBreadcrumbs-separator': { color: '#666' } }}
              >
                <Link 
                  color="#999" 
                  underline="hover" 
                  sx={{ cursor: 'pointer', fontSize: '0.875rem' }}
                  onClick={onBackClick}
                >
                  {bundle?.name}
                </Link>
                <Typography color="#ccc" fontSize="0.875rem">
                  {subBundle?.name}
                </Typography>
                <Typography color="white" fontSize="0.875rem" fontWeight="medium">
                  Choose Tier
                </Typography>
              </Breadcrumbs>
            </motion.div>

            <Stack direction="row" alignItems="center" spacing={3}>
              {/* Back Button */}
              <motion.div
                variants={buttonVariants}
                whileHover="hover"
                whileTap="tap"
              >
                <IconButton
                  onClick={onBackClick}
                  sx={{
                    bgcolor: 'rgba(255, 255, 255, 0.1)',
                    backdropFilter: 'blur(10px)',
                    border: '1px solid rgba(255, 255, 255, 0.2)',
                    color: 'white',
                    '&:hover': {
                      bgcolor: 'rgba(156, 39, 176, 0.2)',
                      borderColor: 'rgba(156, 39, 176, 0.4)'
                    }
                  }}
                >
                  <ArrowLeft size={20} />
                </IconButton>
              </motion.div>

              <Box sx={{ flex: 1 }}>
                {/* Bundle Info */}
                <motion.div
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ delay: 0.4, duration: 0.6 }}
                >
                  <Stack direction="row" alignItems="center" spacing={2} sx={{ mb: 2 }}>
                    <Paper
                      sx={{
                        p: 1,
                        borderRadius: 2,
                        bgcolor: 'rgba(156, 39, 176, 0.2)',
                        border: '1px solid rgba(156, 39, 176, 0.3)'
                      }}
                    >
                      <Shield size={20} color="#9c27b0" />
                    </Paper>

                    <Chip
                      label={bundle?.name?.replace(' SUITE', '') || 'Security Suite'}
                      size="small"
                      sx={{
                        bgcolor: 'rgba(33, 150, 243, 0.2)',
                        color: '#2196f3',
                        border: '1px solid rgba(33, 150, 243, 0.3)',
                        fontWeight: 'medium'
                      }}
                    />
                  </Stack>
                </motion.div>

                {/* Sub-bundle Title */}
                <motion.div
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ delay: 0.5, duration: 0.6 }}
                >
                  <Typography 
                    variant="h3" 
                    fontWeight="bold" 
                    color="white"
                    sx={{ mb: 1 }}
                  >
                    {subBundle?.name?.replace(' Package', '') || 'Security Package'}
                  </Typography>
                </motion.div>

                {/* Description */}
                <motion.div
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ delay: 0.6, duration: 0.6 }}
                >
                  <Typography 
                    variant="h6" 
                    color="#aaa"
                    sx={{ mb: 3, maxWidth: 600 }}
                  >
                    Choose the tier that best fits your security needs. Each tier builds upon the previous with additional features and capabilities.
                  </Typography>
                </motion.div>

                {/* Feature Highlights */}
                <motion.div
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ delay: 0.7, duration: 0.6 }}
                >
                  <Stack direction="row" spacing={2} flexWrap="wrap">
                    <Paper
                      sx={{
                        px: 2,
                        py: 1,
                        bgcolor: 'rgba(76, 175, 80, 0.1)',
                        border: '1px solid rgba(76, 175, 80, 0.3)',
                        borderRadius: 2
                      }}
                    >
                      <Stack direction="row" spacing={1} alignItems="center">
                        <Package size={16} color="#4caf50" />
                        <Typography variant="body2" color="#4caf50" fontWeight="medium">
                          3 Tier Options
                        </Typography>
                      </Stack>
                    </Paper>

                    <Paper
                      sx={{
                        px: 2,
                        py: 1,
                        bgcolor: 'rgba(255, 193, 7, 0.1)',
                        border: '1px solid rgba(255, 193, 7, 0.3)',
                        borderRadius: 2
                      }}
                    >
                      <Stack direction="row" spacing={1} alignItems="center">
                        <Star size={16} color="#ffc107" />
                        <Typography variant="body2" color="#ffc107" fontWeight="medium">
                          Most Popular: Plus
                        </Typography>
                      </Stack>
                    </Paper>

                    <Paper
                      sx={{
                        px: 2,
                        py: 1,
                        bgcolor: 'rgba(156, 39, 176, 0.1)',
                        border: '1px solid rgba(156, 39, 176, 0.3)',
                        borderRadius: 2
                      }}
                    >
                      <Stack direction="row" spacing={1} alignItems="center">
                        <TrendingUp size={16} color="#9c27b0" />
                        <Typography variant="body2" color="#9c27b0" fontWeight="medium">
                          Scalable Solutions
                        </Typography>
                      </Stack>
                    </Paper>
                  </Stack>
                </motion.div>
              </Box>
            </Stack>
          </Box>
        </Container>
      </Box>
    </motion.div>
  );
};

export default EnhancedTierHeader;
